 // AI 리포트 분석 함수
 const callGeminiReport = async (data, retryCount = 0) => {
 setAiReportLoading(true);
 const prompt = AI_CHARACTER_PROMPT + '\n\n═══════════════════════════════════════════════════════════════\n영업 현황 분석 요청\n═══════════════════════════════════════════════════════════════\n\n【담당자 실적】\n- 담당자: ' + data.managerName + '\n- 이번 달 방문: ' + data.thisVisits + '건 (전월 대비 ' + (data.visitChange >= 0 ? '+' : '') + data.visitChange + '%)\n- 신규 업체: ' + data.newCompanies + '개\n- 완료 상담: ' + data.consults + '건\n- 긍정 반응률: ' + data.positiveRate + '%\n\n【업체 반응 분포】\n- 긍정: ' + data.positive + '개 | 특별관리: ' + data.special + '개\n- 보통: ' + data.neutral + '개 | 부재: ' + data.missed + '개\n\n【분석 요청】\n1. comment: 현재 영업 상황 요약 (2줄)\n2. analysis: 데이터 기반 인사이트 (강점/약점)\n3. suggestion: 오늘 할 일 추천 (구체적)\n4. encouragement: 멘탈 케어 한마디\n5. focus: 이번 주 집중 포인트\n\n응답 형식 (JSON만):\n{"comment": "...", "analysis": "...", "suggestion": "...", "encouragement": "...", "focus": "..."}\n\nJSON만 출력하세요.';

 try {
 const response = await fetch(
 `https://generativelanguage.googleapis.com/v1beta/models/gemini-2.0-flash:generateContent?key=${GEMINI_API_KEY}`,
 {
 method: 'POST',
 headers: { 'Content-Type': 'application/json' },
 body: JSON.stringify({
 contents: [{ role: 'user', parts: [{ text: prompt }] }],
 generationConfig: { temperature: 0.7, maxOutputTokens: 1024 }
 })
 }
 );
 
 // 429 에러 시 자동 재시도
 if (response.status === 429 && retryCount < 3) {
 console.log(`429 에러 - ${retryCount + 1}번째 재시도 중... (5초 후)`);
 await new Promise(resolve => setTimeout(resolve, 5000));
 return callGeminiReport(data, retryCount + 1);
 }
 
 const result = await response.json();
 const text = result.candidates?.[0]?.content?.parts?.[0]?.text || '';
 // JSON 파싱 시도
 const jsonMatch = text.match(/\{[\s\S]*\}/);
 if (jsonMatch) {
 const parsed = JSON.parse(jsonMatch[0]);
 setAiReportResult(parsed);
 } else {
 setAiReportResult({ comment: text, analysis: '', suggestion: '', encouragement: '' });
 }
 } catch (e) {
 console.error('AI Report Error:', e);
 setAiReportResult({ comment: '분석 중 오류가 발생했습니다.', analysis: '', suggestion: '다시 시도해주세요.', encouragement: '' });
 }
 setAiReportLoading(false);
 };

